import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 20, height: 20, viewBox: "0 0 20 20", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M6 4a2 2 0 00-2 2v1c0 1.1.9 2 2 2h8a2 2 0 002-2V6a2 2 0 00-2-2H6zM5 6a1 1 0 011-1h8a1 1 0 011 1v1a1 1 0 01-1 1H6a1 1 0 01-1-1V6zm1 5a2 2 0 00-2 2v1c0 1.1.9 2 2 2h8a2 2 0 002-2v-1a2 2 0 00-2-2H6zm-1 2a1 1 0 011-1h8a1 1 0 011 1v1a1 1 0 01-1 1H6a1 1 0 01-1-1v-1z", fill: primaryFill }));
};
const AlignSpaceAroundVertical20Regular = wrapIcon(rawSvg({}), 'AlignSpaceAroundVertical20Regular');
export default AlignSpaceAroundVertical20Regular;
